DROP TABLE IF EXISTS alleged;
CREATE TABLE alleged(
   ID               INTEGER  NOT NULL PRIMARY KEY 
  ,criminal_charges VARCHAR(77) NOT NULL
  ,mental_illness   VARCHAR(19) NOT NULL
  ,armed_unarmed    VARCHAR(34) NOT NULL
  ,alleged_weapon   VARCHAR(32) NOT NULL
  ,alleged_threat   VARCHAR(15) NOT NULL
  ,fleeing          VARCHAR(11)
  
  ,foreign key (ID) references victim (ID)
);
